what if the ms. initials are of his (John Edward's) father:  Sir Edward Swinburne, 5th Baronet (1733-1786)?  he (Sir Edward) was a merchant at Bordeaux in 1763 at the time of his brother's (Sir John Swinburne, 4th Baronet, 1724-1763) death, when he would therefore have assumed the title (&quot;bart.&quot;).  this would put him in an extraordinarily convenient place to pick up a small duodecimo vol. of French language poetry, and possibly justify the (relatively) humble use of mere initials, sans honorifics, as provenance.  just a thought, but...

my supposition is that the initials are, indeed, of Edward Swinburne, previous to assuming the baronetcy.

