founded 1647 as &quot;Herzogliche Bibliothek&quot;, and in 1650 acquired the &quot;Bibliotheca Gerhardina&quot;; renamed &quot;Landesbibliothek&quot;; renamed &quot;Forschungsbibliothek&quot; in 1969; is referred to in the 1990's as &quot;Forschungs- und Landesbibliothek Gotha&quot;...

the library is now part of Universität Erfurt (heading): &quot;Universitäts- und Forschungsbibliothek Erfurt/Gotha&quot;

this library consists of two parts, while physically distinct, operated in common:

&quot;Die Bibliothek der Universität Erfurt besteht aus zwei Häusern. Sie bilden durch ihre Organisation und ihre Dienstleistungen eine gemeinsame Einrichtung.&quot;--

